 "worksheets": [
  {
   "cells": [
... 
   {
     "cell_type": "code",
     "collapsed": false,
     "input": [
      "reportStart()\n",
      "print dbCollectionTweets.find({\"entities\" : {\"$exists\":True}\n",
      "    , \"entities.media\":{\"$elemMatch\":{\"entityDownloaded\":True}}}\n",
      "    , {\"entities\":1,\"id\":1,\"created_at\":1, \"text\":1},timeout=False).count()\n",
      "reportEnd()reportStart()\n",
      "print dbCollectionTweets.find({\"entities\" : {\"$exists\":True}\n",
      "    , \"entities.media\":{\"$elemMatch\":{\"entityDownloaded\":True}}}\n",
      "    , {\"entities\":1,\"id\":1,\"created_at\":1, \"text\":1},timeout=False).count()\n",
      "reportEnd()"
     ],
     "language": "python",
     "metadata": {},
     "outputs": [
      {
       "output_type": "stream",
       "stream": "stdout",
       "text": [
        "starting at 2014-03-18 05:56:28.788667\n",
        "570522"
       ]
      },
      {
       "output_type": "stream",
       "stream": "stdout",
       "text": [
        "\n",
        "done at 2014-03-18 05:56:31.741551\n",
        "it took 2 seconds (0.05 minutes)\n"
       ]
      }
     ],
     "prompt_number": 6
    },
...

   ],
   "metadata": {}
  }
 ]
}
